я зовут Дарья я с г. Калининграда мне очень советуют вашу клинику документы на квоту я собрала на следующей недели подаю документы на квоту мне надо определиться с клиникой и врачом. У нас в Калининграде мне сказали что на Питер я быстро получу квоту чуть ли не за несколько дней. По отзывам мне очень понравилась ваша отношение и работа. К нам на днях приезжал врач с вашей клиники ни чего не могу сказать но если честно я не впечатлилась отношением к делу. Поэтому заинтересовалась взаимодействием с вами. Если вы не против я бы хотела с вами контактировать. у меня начало цикла сейчас на 24 мая начинается а следующий цикл должен быть на 21 июня и я хотела бы к этому времени попасть к вам на протокол ЭКО+ИКСИ по ОМС.У нас в городе было 4 попытки ЭКО из них 3 крио и все без имплантации. Мне 33 года а мужу 34 года у нас мужской фактор. Есть один ребенок девочка 8 лет делали ЭКО+ИКСИ в Польше. Мне предлагали сделать ПГД я все понимаю но финансово мы не потянем. Может вы как высокий специалист поможете нам и предложите вариант какой-нибудь другой мы уже просто отчаялись и решились на последнюю попытку. Кариотип у нас в норме все анализы у меня есть на руках если вы согласитесь нас принять я могу вам выслать все наши документы. Жду от вас ответа. Спасибо";s:5:"files";s:0:"";s:4:"date";s:14:"19 мая 2023";}s:6:"answer";a:8:{s:5:"title";s:10:"Ответ";s:4:"name";s:50:"Савина Валентина Андреевна";s:5:"image";a:18:{s:8:"ORIGINAL";s:27:"/upload/main/1ff/savina.png";s:13:"webp_ORIGINAL";s:50:"/upload/resize_cache/main/1ff/0_0_1_95/savina.webp";s:9:"100_100_P";s:50:"/upload/resize_cache/main/1ff/100_100_1/savina.png";s:14:"webp_100_100_P";s:54:"/upload/resize_cache/main/1ff/100_100_1_95/savina.webp";s:19:"quotas_registration";s:50:"/upload/resize_cache/main/1ff/190_200_1/savina.png";s:24:"webp_quotas_registration";s:54:"/upload/resize_cache/main/1ff/190_200_1_95/savina.webp";s:15:"specialist_list";s:50:"/upload/resize_cache/main/1ff/352_304_1/savina.png";s:20:"webp_specialist_list";s:5